,p_display_name=>'pDatetimePicker'
,p_supported_ui_types=>'DESKTOP'
,p_javascript_file_urls=>wwv_flow_utilities.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#jquery.datetimepicker#MIN#.js',
'#PLUGIN_FILES#moment#MIN#.js',
''))
,p_css_file_urls=>wwv_flow_utilities.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#jquery.datetimepicker#MIN#.css',
''))
,p_plsql_code=>wwv_flow_utilities.join(wwv_flow_t_varchar2(
'/*-------------------------------------',
' * DatetimePicker',
' * Version: 1.1 (21.12.2015)',
' * Author:  Steffen Clauß',
' *-------------------------------------',
'*/ ',
'',
'function render_datetime_item ',
'(',
'	p_item                  in apex_plugin.t_page_item,',
'   	p_plugin                in apex_plugin.t_plugin,',
'   	p_value                 in varchar2,',
'   	p_is_readonly           in boolean default false,',
'   	p_is_printer_friendly   in boolean default false',
')',
'return apex_plugin.t_page_item_render_result',
'is',
'',
'	l_name               varchar2(30);',
'   	l_result             apex_plugin.t_page_item_render_result;',
'    ',
'    v_primary_language 	 varchar2(100);',
'    v_app_id 			 varchar2(100) := v(''APP_ID'');',
'   ',
'     ',
'   	--get custom attributes',
'    v_show_timepicker 	p_item.attribute_01%type := nvl(p_item.attribute_01, ''Y'');   ',
'   	v_show_datepicker   p_item.attribute_02%type := nvl(p_item.attribute_02, ''Y'');',
'	v_show_kw      		p_item.attribute_03%type := nvl(p_item.attribute_03, ''N'');       ',
'    ',
'    v_time_intervall	p_item.attribute_04%type := nvl(p_item.attribute_04, 60);',
'	v_round	     		p_item.attribute_05%type := nvl(p_item.attribute_05, ''round'');',
'    ',
'    v_format_date	    p_item.attribute_06%type := nvl(p_item.attribute_06, ''DD.MM.YYYY'');',
'    v_format_time	    p_item.attribute_07%type := nvl(p_item.attribute_07, ''HH:mm'');',
'    ',
'    v_weekend_enabled	p_item.attribute_08%type := nvl(p_item.attribute_08, ''N'');',
'    v_min_date			p_item.attribute_09%type := nvl(p_item.attribute_09, null);',
'    v_max_date			p_item.attribute_10%type := nvl(p_item.attribute_10, null);',
'    v_language			p_item.attribute_11%type := nvl(p_item.attribute_11, null);',
'    v_default_date      p_item.attribute_12%type := nvl(p_item.attribute_12, null);',
'    v_default_time      p_item.attribute_13%type := nvl(p_item.attribute_13, null);    ',
'	 ',
'	v_format			varchar2(30);',
'   ',
'   	v_html varchar2(9000);',
'    ',
'begin',
'',
'	-- During plug-in development it''s very helpful to have some debug information',
'	if apex_application.g_debug then',
'    	apex_plugin_util.debug_page_item ',
'      	(',
'        	p_plugin                => p_plugin,',
'         	p_page_item             => p_item,',
'         	p_value                 => p_value,',
'         	p_is_readonly           => p_is_readonly,',
'         	p_is_printer_friendly   => p_is_printer_friendly',
'      	);',
'   	end if;',
'    ',
'    ',
'   	if (p_is_readonly or p_is_printer_friendly) then    ',
'    	apex_plugin_util.print_hidden_if_readonly ',
'      	(',
'        	p_item_name             => p_item.name,',
'         	p_value                 => p_value,',
'         	p_is_readonly           => p_is_readonly,',
'         	p_is_printer_friendly   => p_is_printer_friendly',
'      	);',
'',
'      	apex_plugin_util.print_display_only ',
'      	(',
'        	p_item_name          => p_item.NAME,',
'         	p_display_value      => p_value,',
'         	p_show_line_breaks   => FALSE,',
'         	p_escape             => TRUE,',
'         	p_attributes         => p_item.element_attributes',
'      	);',
'',
'	else',
'',
'		--get the name attribute for the item',
'      	l_name := apex_plugin.get_input_name_for_page_item(p_is_multi_value => false);',
'',
'     	--get environment language',
'        select nvl(application_primary_language,''de'')',
'        into v_primary_language',
'        from apex_applications ',
'        where application_id = v_app_id;',
'               ',
'      	--print item',
'         sys.htp.p(''<input type="text" id="'' || p_item.name || ''" ',
'                           value="'' || apex_plugin_util.escape(p_value,true) || ''" ',
'                           size="'' || p_item.element_width || ''" '' || ''',
'                           maxlength="'' || p_item.element_max_length || ''" ',
'                           height="'' || p_item.element_height ||''" '' || p_item.element_attributes || '' ',
'                           name="'' || l_name ||''"/>',
'                    <span id="'' || p_item.name || ''_dtp" class="a-Icon icon-calendar"></span>''',
'                  );',
'                  ',
'        --set datepicker to default',
'        if (v_show_timepicker = ''N'' and v_show_datepicker = ''N'') then',
'        	v_show_datepicker := ''Y'';',
'        end if;   ',
'        ',
'        --set format & mask',
'		if (v_show_datepicker = ''Y'' and v_show_timepicker = ''N'') then',
'        	v_format := v_format_date;',
'        elsif (v_show_datepicker = ''N'' and v_show_timepicker = ''Y'') then',
'            v_format := v_format_time;',
'        else',
'        	v_format := v_format_date || '' '' || v_format_time;',
'		end if;',
'		',
'		--set language option',
'  		if (v_language is null) then',
'			v_language := v_primary_language;',
'		end if;',
'        ',
'		--set default date',
'		if (v_min_date is not null or v_max_date is not null) then',
'			v_default_date := nvl(v_min_date, v_max_date);',
'		end if;	        ',
'        ',
'        --convert Oracle-Date to JS-Date with moment.js',
'        v_html :=  v_html || ',
'		''',
'            Date.parseDate = function( input, format ) {',
'          		return moment(input,format).toDate();',
'        	 };',
'        	 Date.prototype.dateFormat = function( format ){',
'          		return moment(this).format(format);',
'        	 };',
'		'';        ',
'        ',
'        --set options for Datetimepicker',
'	    v_html :=  v_html || ''$.datetimepicker.setLocale("'' || v_language || ''");'';',
'		v_html :=  v_html || ''$("#'' || p_item.name || ''").datetimepicker({       	',
'    			dayOfWeekStart: 1,',
'                timepicker: ''  || case when v_show_timepicker = ''Y'' then ''true'' else ''false'' end || '',',
'				datepicker: ''  || case when v_show_datepicker = ''Y'' then ''true'' else ''false'' end || '',',
' 		   		weeks: ''       || case when v_show_kw = ''Y'' then ''true'' else ''false'' end || '',',
'                step: ''  	   || v_time_intervall || '',',
'                roundTime: "''  || v_round || ''",',
'                format: "''     || v_format || ''",',
'				formatTime: "'' || v_format_time || ''",                ',
'                formatDate: "'' || v_format_date || ''",',
'				'' || case when v_min_date is not null then '' minDate: "'' || v_min_date || ''",'' end || ''            ',
'				'' || case when v_max_date is not null then '' maxDate: "'' || v_max_date || ''",'' end || ''            ',
'	            '' || case when v_default_date is not null then '' defaultDate: "'' || v_default_date || ''",'' end || ''            ',
'                '' || case when v_default_time is not null then '' defaultTime: "'' || v_default_time || ''",'' end || ''            ',
'    			'' || case when v_weekend_enabled = ''N'' then ',
'    			''onGenerate:function( ct ) {',
'    				jQuery(this).find(".xdsoft_date.xdsoft_weekend").addClass("xdsoft_disabled");',
' 	 			}'' end || ''',
'     	   });',
'      	'';',
'        ',
'		--set event for datepicker-icon',
'		v_html :=  v_html || ''$("#'' || p_item.name || ''_dtp").click(function() {',
'  			$("#'' || p_item.name || ''").datetimepicker("show");',
'		});',
'      	'';        ',
'        ',
'        --if debug show generated code',
'        if apex_application.g_debug then',
'       		apex_debug_message.message(p_message => ''JS Onload: '' || v_html);',
'		end if;',
'        ',
'      	-- add onload code',
'      	apex_javascript.add_onload_code (p_code => v_html);',
'',
'      	-- Tell APEX that this field is navigable',
'      	l_result.is_navigable := true;',
'',
'	end if;',
'',
'	return l_result;',
'',
'end render_datetime_item;'))
,p_render_function=>'render_datetime_item'
,p_standard_attributes=>'VISIBLE:SESSION_STATE:READONLY:ESCAPE_OUTPUT:ELEMENT:WIDTH'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
